NOOT.Object.description:
The purpose of this module is to provide a clear object model for OOJS programming. This is a base Class
implementation using the factory pattern. An implementation of 'super' inspired by John Resig is also available to
make this object model more scalable.

### Create a class

``` javascript
var Person = NOOT.Object.extend({
  firstName: '',
  lastName: '',

  init: function() {
    if(!this.lastName || !this.firstName) throw new Error('John Doe is a myth');
  },

  sayHello: function() {
    console.log('Hello, my name is', this.getFullName());
  },

  getFullName: function() {
    return this.firstName + ' ' + this.lastName;
  }
});


var person = Person.create({
  firstName: 'John',
  lastName: 'Doe'
});

person.sayHello();
// Hello, my name is John Doe
```

### Extend a class

``` javascript
var Employee = Person.extend({
  job: '',

  sayHello: function() {
    console.log(this._super(), ', I work as a ', this.job);
  }
});


var employee = Employee.create({
  firstName: 'John',
  lastName: 'Doe',
  job: 'developer'
});

employee.sayHello();
// Hello, my name is John Doe, I work as a developer
```

classitems.description:
Create an array from an `arguments` instance.

```javascript
var myFunction = function() {
  var args = NOOT.makeArray(arguments); // `args` is now a JS array instance
};
```

Rename an object's property by copying the value of the old property to the new one and deleting the old.

```javascript
var myObj = { one: 'bar', two: 'foo' };
NOOT.renameProperty(myObj, 'one', 'first); // { first: 'bar', two: 'foo' }
```

Rename multiple properties. Same as `renameProperty` but this time you can provide a map of
properties to be replaced.

```javascript
var myObj = { one: 'bar', two: 'foo' };
NOOT.renameProperties(myObj, { one: 'first', two: 'second' }); // { first: 'bar', second: 'foo' }
```
